function Contact() {
  return (
    <div className="container contact">
      <h2 className="main-title text-center">CONTACT</h2>
        <div>
                <a href="https://www.instagram.com/ur.acm/" target="_blank"><i class="fa fa-instagram fa-2x"></i></a>
                <a href="https://github.com/acmurichmond?tab=repositories" target="_blank"><i class="fa fa-github fa-2x"></i></a>
                <a href="mailto:acm.urichmond@gmail.com"><i class="fa fa-envelope fa-2x" aria-hidden="true"></i></a>
                <a href="https://discord.gg/EPW8t4FdCJ" target="_blank"><i class="fab fa-discord fa-2x"></i></a>
        </div>

    </div>
  );
}
export default Contact;
